import axios from "axios";
axios.defaults.baseURL = process.env.REACT_APP_PRODUCTION
  ? process.env.REACT_APP_PRODUCTION_URL
  : process.env.REACT_APP_LOCALHOST_URL;
//interceptors

export default axios;
